import React from "react";
import {Link} from "react-router-dom";
import Logo from "./logo.png"
import "./nav.css";

function Nav() {
  return (
    //<nav className="navbar navbar-expand-lg navbar-dark bg-primary test">
      //<Link to='/'> Huddle </Link>
      //<Link to='/active'> Active </Link>
      //<Link to='/report'> Report </Link>
      //<Link to='/profile'> Profile </Link>

    //</nav>


<nav className="navbar navbar-expand-lg navbar-light bg-light">
  <a className="navbar-brand" href="#"><img className="Logo" src={Logo}/></a>
  <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
    <span className="navbar-toggler-icon"></span>
  </button>

  <div className="collapse navbar-collapse" id="navbarSupportedContent">
    <ul className="navbar-nav mr-auto">
      <li className="nav-item active">
        <a className="nav-link" href="/">Huddle <span class="sr-only">(current)</span></a>
      </li>
      <li className="nav-item">
        <a className="nav-link" href="/active">Active</a>
      </li>
      <li className="nav-item">
        <a className="nav-link" href="/report">Report</a>
      </li>
      <li className="nav-item">
        <a className="nav-link" href="/profile">Profile</a>
      </li>
    </ul>

  </div>
</nav>
  );
}

export default Nav;
